import React, { Component } from 'react';

import FileViewer from 'react-file-viewer';

const file = 'http://mysite.com/sampledoc.pdf'
const type = 'pdf'

class ExamplePDFViewer extends Component {
  render() {
    return (
      <FileViewer
        fileType={type}
        filePath={file}
    
/>
    );
  }

}

export default ExamplePDFViewer
